using namespace std;

int main() {

	long long n; cin >> n;

	unsigned long long Sum_A = 0;

	vector<unsigned long long> A(n);
	for (long long i = 0; i < n; ++i) {
		cin >> A[i];
		Sum_A += A[i];
	}

	vector<unsigned long long> B(n);
	for (long long i = 0; i < n; ++i) { cin >> B[i]; }


	multiset<long long, greater<long long>> B_Minus_A;
	for (long long i = 0; i < n; ++i) { B_Minus_A.insert(B[i] - A[i]); }

	unsigned long long Accum_First_Half_B_Minus_A = accumulate(B_Minus_A.begin(), next(B_Minus_A.begin(), n / 2), 0);
	//cout << "Accum_First_Half_B_Minus_A: " << Accum_First_Half_B_Minus_A << '\n';

	multiset<long long, greater<long long>>  first_half = { B_Minus_A.begin(), next(B_Minus_A.begin(), (n / 2)) };
	multiset<long long, greater<long long>>  second_half = { next(B_Minus_A.begin(), n / 2), B_Minus_A.end() };

	//cout << "size: " << first_half.size() << '\n';
	//cout << "size: " << second_half.size() << '\n';
	unsigned long long ans;


	long long m; cin >> m;
	for (long long i = 0; i < m; ++i) {

		long long numb, type, d; cin >> numb >> type >> d;
		--numb;



		const long long prev_diff = B[numb] - A[numb];
		if (type == 1) {
			Sum_A += d;
			A[numb] += d;
		}
		else {
			B[numb] += d;
		}
		const long long new_diff = B[numb] - A[numb];



		// new_diff in second_half | prev_diff in second_half
		if (*second_half.begin() >= new_diff && *second_half.begin() >= prev_diff) {

			ans = Sum_A + Accum_First_Half_B_Minus_A;
			cout /*<< "1: " */ << ans << '\n';

			second_half.erase(second_half.find(prev_diff));
			second_half.insert(new_diff);

			continue;
		}


		// new_diff in first_half | prev_diff in first_half
		if (*second_half.begin() < new_diff && *second_half.begin() < prev_diff) {

			Accum_First_Half_B_Minus_A = Accum_First_Half_B_Minus_A - prev_diff + new_diff;
			ans = Sum_A + Accum_First_Half_B_Minus_A;
			cout /*<< "2: " */ << ans << '\n';

			first_half.erase(first_half.find(prev_diff));
			first_half.insert(new_diff);

			continue;
		}


		// new_diff in second_half | prev_diff in first_half
		if (*second_half.begin() >= new_diff && *second_half.begin() < prev_diff) {

			Accum_First_Half_B_Minus_A = Accum_First_Half_B_Minus_A - prev_diff + *second_half.begin();
			ans = Sum_A + Accum_First_Half_B_Minus_A;
			cout << /*  "3: " <<*/ ans << '\n';

			first_half.erase(first_half.find(prev_diff));
			first_half.insert(*second_half.begin());

			second_half.erase(second_half.begin());
			second_half.insert(new_diff);


			continue;
		}


		// new_diff in first_half | prev_diff in second_half
		if (*second_half.begin() < new_diff && *second_half.begin() >= prev_diff) {

			Accum_First_Half_B_Minus_A = Accum_First_Half_B_Minus_A + new_diff - *prev(first_half.end());
			ans = Sum_A + Accum_First_Half_B_Minus_A;
			cout /* << "4: " */ << ans << '\n';

			second_half.erase(second_half.find(prev_diff));
			second_half.insert(*prev(first_half.end()));

			first_half.erase(prev(first_half.end()));
			first_half.insert(new_diff);
		}
	}
}

