public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int fieldSize = Integer.parseInt(sc.nextLine());

        char[][] field = new char[fieldSize][fieldSize];

        int squirrelRow = -1;
        int squirrelCol = -1;
