#pragma once

#include <algorithm>
#include <cstddef>
#include <initializer_list>
#include <iterator>

template <class T>
class Vector {
public:
    Vector() {
        data_ = nullptr;
        size_ = 0;
        capacity_ = 0;
    }
    explicit Vector(size_t size) {
        if (size != 0) {
            size_ = size;
            capacity_ = size_;
            data_ = new int[capacity_];
            for (size_t i = 0; i < size_; ++i) {
                data_[i] = 0;
            }
        }
    }

    Vector(std::initializer_list<int> list) {
        if (list.size() != 0) {
            size_ = list.size();
            capacity_ = size_;
            data_ = new int[capacity_];
            size_t i = 0;
            for (auto list_it = list.begin(); list_it != list.end(); ++list_it) {
                data_[i] = *list_it;
                ++i;
            }
        }
    }

    Vector(const Vector& other) {
        if (other.capacity_ != 0) {
            size_ = other.size_;
            capacity_ = other.capacity_;
            data_ = new int[capacity_];
            for (size_t i = 0; i < size_; ++i) {
                data_[i] = other.data_[i];
            }
        } else {
            data_ = nullptr;
            size_ = 0;
            capacity_ = 0;
        }
    }

    Vector(Vector&& other) noexcept {
        size_ = other.size_;
        capacity_ = other.capacity_;
        data_ = other.data_;
        other.size_ = 0;
        other.capacity_ = 0;
        other.data_ = nullptr;
    }

    ~Vector() {
        delete[] data_;
    }

    Vector& operator=(const Vector& other) {
        if (this->data_ != other.data_ || other.data_ != nullptr) {
            delete[] data_;
            size_ = other.size_;
            capacity_ = other.capacity_;
            data_ = new int[capacity_];
            for (size_t i = 0; i < size_; ++i) {
                data_[i] = other[i];
            }
        } else if (other.size_ == 0) {
            delete[] data_;
            size_ = 0;
            capacity_ = 0;
            data_ = nullptr;
        }
        return *this;
    }

    Vector& operator=(Vector&& other) noexcept {
        if (this != &other) {
            delete[] data_;
            size_ = other.size_;
            capacity_ = other.capacity_;
            data_ = other.data_;
            other.size_ = 0;
            other.capacity_ = 0;
            other.data_ = nullptr;
        }
        return *this;
    }

    void Swap(Vector& other) {
        std::swap(size_, other.size_);
        std::swap(capacity_, other.capacity_);
        std::swap(data_, other.data_);
    }

    int& operator[](size_t index) {
        return data_[index];
    }

    const int& operator[](size_t index) const {
        return data_[index];
    }

    size_t Size() const {
        return size_;
    }

    size_t Capacity() const {
        return capacity_;
    }

    void PushBack(int value) {
        if (data_ == nullptr || capacity_ == 0) {
            size_ = 1;
            capacity_ = 1;
            data_ = new int[1];
            data_[0] = value;
        } else if (size_ == capacity_) {
            Reserve(2 * capacity_);
            data_[size_] = value;
            ++size_;
        } else {
            data_[size_] = value;
            ++size_;
        }
    }

    void PopBack() {
        if (size_ > 0) {
            --size_;
        }
    }

    void Clear() {
        if (data_ != nullptr) {
            delete[] data_;
            if (capacity_ > 0) {
                data_ = new int[capacity_];
            }
            size_ = 0;
        }
    }

    void Reserve(size_t new_capacity) {
        if (new_capacity > capacity_) {
            capacity_ = new_capacity;
            if (data_ != nullptr && capacity_ != 0) {
                int* temp_data = new int[new_capacity];
                for (size_t i = 0; i < size_; ++i) {
                    temp_data[i] = data_[i];
                }
                size_t temp_size = size_;
                Clear();
                size_ = temp_size;
                for (size_t i = 0; i < size_; ++i) {
                    data_[i] = temp_data[i];
                }
            } else {
                data_ = new int[new_capacity];
            }
        }
    }

    class Iterator : public std::iterator<std::random_access_iterator_tag, int> {
    public:
        Iterator() {
            ptr_ = nullptr;
        }

        explicit Iterator(int* ptr) {
            ptr_ = ptr;
        }

        Iterator(const Iterator& other) {
            ptr_ = other.ptr_;
        }

        int& operator*() const {
            return *ptr_;
        }

        Iterator& operator++() {
            ++ptr_;
            return *this;
        }

        Iterator operator++(int) {
            Iterator old = *this;
            ++(*this);
            return old;
        }

        Iterator& operator--() {
            --ptr_;
            return *this;
        }

        Iterator operator--(int) {
            Iterator old = *this;
            --(*this);
            return old;
        }

        Iterator operator=(int* other) {
            ptr_ = other;
            return *this;
        }

        Iterator operator+(int n) const {
            return Iterator(ptr_ + n);
        }

        Iterator operator-(int n) const {
            return Iterator(ptr_ - n);
        }

        size_t operator-(const Iterator& other) const {
            return ptr_ - other.ptr_;
        }

        Iterator& operator+=(int value) {
            ptr_ += value;
            return *this;
        }

        Iterator& operator-=(int value) {
            ptr_ -= value;
            return *this;
        }

        bool operator==(const Iterator& other) const {
            return ptr_ == other.ptr_;
        }

        bool operator!=(const Iterator& other) const {
            return ptr_ != other.ptr_;
        }

        int* operator->() {
            return ptr_;
        }

    private:
        int* ptr_;
    };

    Iterator Begin() {  // NOLINT
        return Iterator(data_);
    }

    Iterator End() {  // NOLINT
        return Iterator(data_ + size_);
    }

    const Iterator Begin() const {  // NOLINT
        return Iterator(data_);
    }
    const Iterator End() const {  // NOLINT
        return Iterator(data_ + size_);
    }

    Iterator begin() {  // NOLINT
        return Iterator(data_);
    }
    Iterator end() {  // NOLINT
        return Iterator(data_ + size_);
    }
    const Iterator begin() const {  // NOLINT
        return Iterator(data_);
    }
    const Iterator end() const {  // NOLINT
        return Iterator(data_ + size_);
    }

private:
    size_t size_;
    size_t capacity_;
    int* data_;
};

